import React from "react";
import BackgroudImage from "../Images/BackgroundImage.jpeg";
import Img2 from "../Images/img2.jpeg";
import Img3 from "../Images/img3 (2).jpeg";
import { Container, Row, Col , Carousel } from "react-bootstrap";

function BackgroounfImage() {
  return (
    <div>
      <Container>
        <Row>
          <Col className="BackgroundHeading">
            <h1>Get Mehndi Artist</h1>
            <h1>for your wedding Day</h1>
          </Col>
          <Col>
            <Carousel >
              {/* <Carousel.Item interval={2000}>
                <img
                  className="d-block w-100 bgImage"
                  src={BackgroudImage}
                  alt="First slide"
                />
              </Carousel.Item> */}

               {/* <Carousel.Item interval={2000}>
                <img
                  className="d-block w-100 bgImage"
                  src={Img2}
                  alt="Second slide"
                />
              </Carousel.Item> */}

              <Carousel.Item>
                <img
                  className="d-block w-100 bgImage"
                  src={Img3}
                  alt="Third slide"
                />
              </Carousel.Item> 
            </Carousel>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default BackgroounfImage;
